import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter ,Link,Router,  Routes,  Route,Switch } from "react-router-dom";
import Candels from './Candels'
import  Search  from "./Search";

function FetchSearch()

    {  var srch=""
       const a=[1,2,23,4]
        var c=-1
        const [desc,setDes]=useState([])
        const [symbl,setSym]=useState([])
        const [sen,setSend]=useState("")
        var li=[]
        var lii=[]
  
        function fetch(e)
        {
          srch=e.target.value
          
        }
        
        function Inn()
        {
         
       
        axios
                .get(`https://finnhub.io/api/v1/search?q=${srch}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {   var con=0
               const {count}= response.data
               while(con<count){
                const {description,symbol}= response.data.result[con]
                li.push(symbol)
                lii.push(description)
                setDes(lii)
                setSym(li)
                con=con+1
                
               }
                
        })
    }
    ;
    
        
        return(<>
        <input type="text" onChange={fetch}/>
        <button onClick={Inn}>Generate</button>
        <h1>{symbl[0]}</h1>
        {
            
           desc.map((x)=>{
            c=c+1
            
            return <a href="/h" style={{color:"black",textDecoration:'none'}} value={symbl[c]}><h1>name:{x}, symbol:{symbl[c]}</h1></a>
           })
            
          
            }


<BrowserRouter>
      <Routes>
      
          <Route path="h" element={<Candels />} />
          <Route path="search" element={<Search />} />
      </Routes>
    </BrowserRouter>
    <h1>{symbl[0]}</h1>
       </>)
       
    }
    export default FetchSearch
